syntax = "proto3";
import "covesa/ivdct/truck/vehicle/genericvehicle/angularvelocity/angularvelocity.proto";

package COVESA.IVDCT.TRUCK.VEHICLE.GENERICVEHICLE;

message Genericvehicle {
	repeated COVESA.IVDCT.TRUCK.VEHICLE.GENERICVEHICLE.ANGULARVELOCITY.Angularvelocity angularvelocity = 1; // Spatial rotation. Axis definitions according to ISO 8855.
}